Step-by-step reasoning:
1. Key psychological mechanisms include self‐interest (maximizing one’s own monetary gain) versus fairness concerns (making an offer that reflects the relative contributions given by tokens). The proposer values more money for themselves but is averse to deviating too far from what would be considered a “fair” split based on token contributions.
2. These mechanisms interact by having the proposer weigh the benefit of keeping a larger share of the combined earning against the internal penalty for straying from the fairness benchmark implied by the ratio of opponent tokens to total tokens.
3. A quadratic penalty term is a natural mathematical form to capture deviations from the fairness reference point. Thus, the utility can be represented as a weighted sum of the own monetary reward (which increases with a lower percentage offered to the opponent) minus a quadratic cost for deviating from the fairness-proportionate offer.
4. The necessary parameters are:
   • An intercept (alpha) to capture a baseline bias.
   • A reward sensitivity parameter (gamma) that scales the value of the monetary gain.
   • A fairness sensitivity parameter (delta) that determines how strongly deviations (squared) from the fairness benchmark are penalized.
   These parameters have finite bounds: alpha in [–100, 100], gamma in [0, 10] and delta in [0, 10].
