def simulate_model(trial_data, alpha=0, gamma=1, delta=1):
    model_predictions = []
    for trial in trial_data:
        try:
            proposed_perc = trial['proposed_perc']
            combined_earning = trial['combined_earning']
            token_self = trial['token_self']
            token_opp = trial['token_opp']

            if token_self + token_opp ==0:
                fairness_benchmark = 0
            else:
                fairness_benchmark = (token_opp / (token_self + token_opp)) * 100

            U = alpha + gamma * (((100 - proposed_perc) / 100) * combined_earning) - delta * (proposed_perc - fairness_benchmark) ** 2
            model_predictions.append(U)
        except KeyError as e:
            print(f"Error: Missing key in trial data: {e}")
            model_predictions.append(float('nan')) # Handle missing keys gracefully

    return model_predictions
